import { useState, useEffect } from "react";
import axios from "axios";
import { toast } from "react-toastify";
import { useNavigate } from "react-router-dom";

const AddEventForm = () => {
  const [categories, setCategories] = useState([]);
  const [selectedImage1, setSelectedImage1] = useState(null);
  const [event, setEvent] = useState({
    name: "",
    description: "",
    venueName: "",
    venueType: "",
    location: "",
    noOfTickets: "",
    ticketPrice: "",
    startDate: "",
    endDate: "",
    categoryId: "",
  });

  const manager = JSON.parse(sessionStorage.getItem("active-manager"));
  const manager_jwtToken = sessionStorage.getItem("manager-jwtToken");

  let navigate = useNavigate();

  useEffect(() => {
    const retrieveAllCategories = async () => {
      try {
        const response = await axios.get("http://localhost:8080/api/event/category/fetch/all");
        setCategories(response.data.categories);
      } catch (error) {
        toast.error("Failed to fetch categories");
      }
    };
    retrieveAllCategories();
  }, []);

  const handleInput = (e) => {
    setEvent({ ...event, [e.target.name]: e.target.value });
  };

  const validateForm = () => {
    for (let key in event) {
      if (!event[key].toString().trim()) {
        toast.error(`${key.replace(/([A-Z])/g, ' $1')} is required!`);
        return false;
      }
    }
    if (new Date(event.endDate) <= new Date(event.startDate)) {
      toast.error("End Date must be after Start Date!");
      return false;
    }
    if (!selectedImage1) {
      toast.error("Event Image is required!");
      return false;
    }
    return true;
  };

  const saveEvent = async (e) => {
    e.preventDefault();
    if (!validateForm()) return;

    const formData = new FormData();
    Object.keys(event).forEach((key) => formData.append(key, event[key]));
    formData.append("image", selectedImage1);
    formData.append("managerId", manager.id);

    try {
      const response = await axios.post("http://localhost:8080/api/event/add", formData, {
        headers: { Authorization: "Bearer " + manager_jwtToken },
      });
      toast.success(response.data.responseMessage);
      navigate("/home");
    } catch {
      toast.error("It seems the server is down");
    }
  };

  return (
    <div className="container">
      <h2>Add Event</h2>
      <form onSubmit={saveEvent}>
        <input type="text" name="name" placeholder="Event Title" onChange={handleInput} />
        <textarea name="description" placeholder="Event Description" onChange={handleInput}></textarea>
        <select name="categoryId" onChange={handleInput}>
          <option value="">Select Category</option>
          {categories.map((cat) => (
            <option key={cat.id} value={cat.id}>{cat.name}</option>
          ))}
        </select>
        <input type="text" name="venueName" placeholder="Venue Name" onChange={handleInput} />
        <select name="venueType" onChange={handleInput}>
          <option value="">Select Venue Type</option>
          <option value="Conference Centers">Conference Centers</option>
          <option value="Hotels">Hotels</option>
          <option value="Banquet Halls">Banquet Halls</option>
        </select>
        <input type="text" name="location" placeholder="Location" onChange={handleInput} />
        <input type="number" name="noOfTickets" placeholder="Number of Tickets" onChange={handleInput} />
        <input type="number" name="ticketPrice" placeholder="Ticket Price" onChange={handleInput} />
        <input type="date" name="startDate" onChange={handleInput} />
        <input type="date" name="endDate" onChange={handleInput} />
        <input type="file" onChange={(e) => setSelectedImage1(e.target.files[0])} />
        <button type="submit">Add Event</button>
      </form>
    </div>
  );
};

export default AddEventForm;
